Bora curiar o complexo esportivo mais moderno e tecnológico do Brasil? Esse é o Centro de Formação Olímpica (CFO), do Governo do Ceará. 🤩

O equipamento oferece 26 modalidades olímpicas e paralímpicas, e conta com:

* quadras;
* piscinas;
* pistas de atletismo;
* academias;
* campo de futebol;
* quadras de skate e bicicross;
* espaço com toda a aparelhagem para a ginástica olímpica;
* quadras de vôlei de praia, tênis de saibro e de mesa;
* pista metálica de esgrima;
* áreas de luta.

É coisa demais, meu povo! E pra começar, trouxemos este conteúdo sobre a turma de basquete. 🏀 Mas depois tem mais, viu?!

Aperta o play e aproveita pra comentar aqui qual o próximo espaço do CFO você quer curiar. 👀

Ah, e fica sempre de olho no perfil do @cfoceara pra ficar pro dentro dos editais e principais informações.

#esportes #secretariadoesporte #governodoceará #cfo

