Na Cidade Mais Infância, as crianças se divertem enquanto aprendem sobre o Ceará. Tem coisa melhor? 👧🏼🧒🏾

Depois de assistir ao vídeo, convidamos você a trazer o seu pequeno para conhecer esse equipamento que é todinho dele. 🪀🧸🤸

Corra lá no site para agendar a sua visita, mas, antes, confira nossas regras de segurança 👇:
* as crianças devem vir acompanhadas por até 2 responsáveis;
* as brincadeiras são exclusivas para crianças;
* fazemos verificação de altura e idade para cada atividade;
* na areninha, uso de tênis adequado é obrigatório;
* é proibido retirar objetos e brinquedos do seu local de origem.

#governodoceara #cidademaisinfancia #programamaisinfancia #spsce

