Sete concursos estão confirmados para 2022! Assim como em 2021, o próximo ano será de realização de muitos certames pelo Governo do Ceará. Haverá concurso para:

✅ Universidade Estadual do Ceará;
✅ Universidade Estadual Vale do Acaraú;
✅ Universidade Regional do Cariri;
✅ Superintendência Estadual do Meio Ambiente;
✅ Secretaria do Desenvolvimento Agrário;
✅ Secretaria de Proteção Social, Justiça, Cidadania, Mulheres e Direitos Humanos;
✅ Companhia Cearense de Transportes Metropolitanos.

Além disso, no dia 3 de janeiro serão nomeados os aprovados no último concurso da Ematerce.

Nesse ano, o Governo do Ceará realizou concursos públicos para a área da Segurança (Polícia Militar, Polícia Civil e Pefoce), Saúde (Funsaúde), além dos certames da PGE e Sefaz.

#governodoceara #boletimdenoticias #imprensa #concursos
